import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './components/App';
import reportWebVitals from './reportWebVitals';
import Test from './components/Test';
import { useRoutes } from "hookrouter";


class Renders extends Component {
  state = {routesList : ["route1", "route2"], 
  routes : {
    "/": () => <App />,

  }};

  addRoute = (route, category) => {
    console.log(this.state.routesList)
    this.setState(previousState => ({
      routesList: [...previousState.routesList, route]
  }));
  }

  render() {  
    return(<React.StrictMode>
      {this.state.routesList.map((routePoint) => <p>{routePoint}</p>)}
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<App callBackFunction={this.addRoute}/>} />
            {this.state.routesList.map((routePoint) => <Route path={["/", routePoint].join("")} element={<Test point={routePoint}/>}/>)}
          </Routes>
        </BrowserRouter>
      </React.StrictMode>)
  }
};

ReactDOM.render(
  <Renders/>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
